CREATE DEFINER=`root`@`localhost` PROCEDURE `mart_booking` ()   BEGIN
		
	DECLARE done INT DEFAULT FALSE;
	DECLARE JumlahBooking 			INT;
	DECLARE JumlahCancel 			INT;
	DECLARE JumlahKonfirmasiAkanDatang 	INT;
	DECLARE JumlahKonfirmasiWalkin 		INT;  
	declare mingguskr			int;
	
		
	
		
	DECLARE cur1 CURSOR FOR   
			SELECT 
				MAX(IF(aa.stat="Pemesanan",aa.jumlah,"0")) AS JumlahBooking,
				MAX(IF(aa.stat="Batal",aa.jumlah,"0")) AS JumlahCancel,
				MAX(IF(aa.stat="Menunggu konfirmasi klinik",aa.jumlah,"0")) AS JumlahKonfirmasiAkanDatang,
				MAX(IF(aa.stat="Telah dikonfirmasi klinik",aa.jumlah,"0")) AS JumlahKonfirmasiWalkin
			FROM
				(
						SELECT a.xs1 AS stat, IFNULL(bb.jumlah,0) AS jumlah
						FROM params a
						LEFT JOIN
							(
								SELECT b.xs1,`status`,COUNT(*) AS jumlah
								FROM transaksibookings a
								LEFT JOIN params b ON b.xn1=a.`status`
								WHERE 
								      WEEKOFYEAR(a.`created_at`)= WEEKOFYEAR(NOW())
								GROUP BY `status`,b.xs1
							)bb ON bb.status = a.`xn1`
						WHERE
						    a.keterangan ="statusBooking"
				)aa
			;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;			
	
	SELECT MAX(`week`) AS mingguterakhir INTO mingguskr
	FROM mart_booking
	WHERE
		`year` = DATE_FORMAT(NOW(),"%Y")
	;
	
	
	
	OPEN cur1;		
		
		ins_loop: LOOP
				FETCH cur1 INTO
					JumlahBooking,
					JumlahCancel,
					JumlahKonfirmasiAkanDatang,
					JumlahKonfirmasiWalkin
				;
				
				IF done THEN
					LEAVE ins_loop;
				END IF;				
				
				
				
				if mingguskr = WEEKOFYEAR(NOW()) then
				
					update mart_booking a
					set 
						a.jumlahbooking = JumlahBooking,
						a.jumlahcancel = jumlahcancel,
