						WEEKOFYEAR(NOW()) ,
						DATE_FORMAT(NOW(),"%m"),
						DATE_FORMAT(NOW(),"%Y") 
					);
				end if;
					
					
					
		END LOOP ins_loop;
	CLOSE cur1;	
		
		
		
		
	END$$

