CREATE TABLE `antrian` (
  `id` int(11) NOT NULL,
  `tanggalpraktek` date DEFAULT NULL,
  `kodebooking` int(11) DEFAULT NULL,
  `idpraktek` int(11) DEFAULT NULL,
  `idpasien` int(11) DEFAULT NULL,
  `idkeluarga` int(11) NOT NULL,
  `noantrian` int(11) NOT NULL COMMENT 'harus terisi dan total antrian + 1',
  `jam_kedatangan` time DEFAULT NULL,
  `keterangan` varchar(200) DEFAULT NULL,
  `status` int(11) DEFAULT 1 COMMENT '2 = sudah diperiksa, 1 = booked, -1 = cancel by user / system',
  `created_by` int(11) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC;

